import React from "react";
import Nav from "../components/navbar";
import Link from 'next/link';

export default function Index() {
  return (
    <div id="wrapper">
      <Nav />
      <div id="banner">
        <img src="/engine.jpg" />
      </div>

      <h1>About the Company</h1>
      <p>Ready to get your transmission fixed? You have come to right place, down at J and M transmissions we treat you like family because we know how important it is to get your car back on the road, you can <Link href="/contact"><a>contact us</a></Link> about prices and scheduling if you would like to know more!</p>
      <style jsx global>{`
        @import url('https://fonts.googleapis.com/css2?family=Rubik:wght@500&display=swap');
        #wrapper {
          float: left;
          width: 100%;
          background: white;
          margin-top: 0;
          margin: 0;
          padding: 0;
        }
        #banner {
          float: left;
          width: 100%;
          height: 350px;
          overflow: hidden;
          position: relative;
        }
        h1 {
          float: left;
          padding: 20px;
          font: 34px 'Rubik';
          margin: 0;
        }
        p {
          float: left;
          width: 60%;
          font: 18px arial;
          margin: 15px;
          padding: 10px;
        }
        img {
          float: left;
          width: 100%;
          height: 100%;
        }
        `}</style>
    </div>
  );
}
